function Filtered (props) {

    const filteredByName = props.data
       .filter(photo => {
         return photo.name === earring;
       })
       .sort((a, b) => { 
          return a.name - b.name; 
        })
        .map((photo) => { 
          return ( 
              <li key={photo.id}>
                {photo.name} - {photo.price} Euro
              </li> 
          ); 
        }); 
      return <ul>{filteredByName}</ul>; 
      }

  export default Filtered;
